import React, { useState } from 'react';
import { styles } from '../index'; // Import CSS module from index.js

const Deep = () => {
  const [count, setCount] = useState(1);
  const [mouseIn, setMouseIn] = useState(false);

  const demo = () => {
    if (mouseIn) return;
    const element = document.getElementById('demo' + count);
    if (element) {
      element.classList.toggle('hover');
      setCount(prevCount => prevCount + 1);
    }
  };

  const reset = () => {
    setCount(1);
    const hovers = document.querySelectorAll('.hover');
    hovers.forEach(hover => hover.classList.remove('hover'));
  };

  document.addEventListener('mouseover', () => {
    setMouseIn(true);
    reset();
  });

  setTimeout(demo, 500);
  setTimeout(demo, 700);
  setTimeout(demo, 900);
  setTimeout(reset, 2000);
  setTimeout(demo, 2500);
  setTimeout(demo, 2750);
  setTimeout(demo, 3050);

  return (
    <nav>
      <menu>
        <menuitem id="demo1">
          <a>drop</a>
          <menu>
            <menuitem><a>about</a></menuitem>
            <menuitem>
              <a>settings</a>
              <menu>
                <menuitem><a>Test 1</a></menuitem>
                <menuitem><a>Test 2</a></menuitem>
                <menuitem><a>Test 3</a></menuitem>
                <menuitem><a>Test 4</a></menuitem>
              </menu>  
            </menuitem>
            <menuitem><a>help</a></menuitem>
            <menuitem id="demo2">
              <a>more</a>
              <menu>
                <menuitem id="demo3">
                  <a>deeper</a>
                  <menu>
                    <menuitem><a>deep 1</a></menuitem>
                    <menuitem><a>deep 2</a></menuitem>
                    <menuitem><a>deep 3</a></menuitem>
                  </menu>
                </menuitem>
                <menuitem><a>test</a></menuitem>
              </menu>
            </menuitem>
          </menu>
        </menuitem>
        <menuitem><a>no drop</a></menuitem>
      </menu>
    </nav>
  );
};

export default Deep;
